import React, {useEffect, useState} from 'react';

import axios from 'axios';
import Navbar from "./Components/Navbar";
import Footer from "./Components/Footer";

function App() {
    const [done, setDone] = useState(false);

    const [data, setData] = useState(null);

    useEffect(() => {
        axios.get('https://coronavirus-tracker-api.herokuapp.com/all')
            .then(response => {
                const allThree = response.data.latest;

                setData(allThree)
                setDone(true);
            })
    }, []);

    return (
        <React.Fragment>
            <Navbar/>
            <div className='main'>
                {done ? <div className='corona-numbers'>
                    <ul>
                        <li style={'margin-top:2em'}>{data.confirmed}</li>
                        <li>{data.deaths}</li>
                        <li>{data.recovered}</li>
                    </ul>
                </div> : <h5>Loading...</h5>}
            </div>
            <hr/>
            <Footer/>
        </React.Fragment>
    );
}

export default App;
